🧵4/10 - R: Coin Flip Simulation 📊

First, we'll create a simple function to simulate a coin flip:

flip_coin &lt;- function(n) {
  outcomes &lt;- sample(c("H", "T"), n, replace = TRUE)
  return(outcomes)
}

